(1, 6000, 'ERROR', 'Error Build', 'UNKNOWN', 0, 0, '', '', 'Erreur non répertoriée\r\nMessage générique\r\n\r\nentier [%i1] [%i2] [%i3] [%i4] [%i5] [%i6] [%i7] [%i8]\r\nréel [%d1] [%d2] [%d3] [%d4] [%d5] [%i6] [%i7] [%i8]\r\nchaîne [%s1] [%s2] [%s3] [%s4] [%s5]', 'Unknown error\r\nGeneric message\r\n\r\ninteger [%i1] [%i2] [%i3] [%i4] [%i5] [%i6] [%i7] [%i8]\r\ndouble [%d1] [%d2] [%d3] [%d4] [%d5] [%i7] [%i8]\r\nstring [%s1] [%s2] [%s3] [%s4] [%s5]', '', ''),
