(3, 6002, 'DRIVER', 'Driver Load', 'DRV_LOAD', NULL, NULL, NULL, NULL, 'Impossible de charger le driver \"%s1\" !\r\n\r\nDriver : \"%s2\"\r\n- - - - - - - - - -\r\n%s3', 'Unable to load the driver \"%s1\"!\r\n\r\nDriver: \"%s2\"\r\n- - - - - - - - - -\r\n%s3', NULL, NULL),
(4, 6003, 'DRIVER', 'Driver Init', 'DRV_INIT', NULL, 0, NULL, NULL, 'Initialisation du driver \"%s1\" non réalisée !\r\n\r\nInitialisation : \"%s2\"\r\n- - - - - - - - - -\r\n%s3', '\"%s1\" driver initialization aborted!\r\n\r\nInitialization: \"%s2\"\r\n- - - - - - - - - -\r\n%s3', NULL, NULL),
(5, 6004, 'DRIVER', 'Driver Use', 'DRV_USE', NULL, 0, NULL, NULL, '\r\n\r\nImpossible d’appeler la fonction \"%s2\"\r\ndu driver \"%s1\"', '\r\n\r\nThe function \"%s2\"\r\nof the driver \"%s1\" is unavailable', NULL, NULL),
(31, 6511, 'USER', 'Human interface - Aswer', 'USER_PROMPT', NULL, 2, NULL, NULL, 'La saisie au message [%s2]\r\n\r\n%s1\r\n\r\na été abandonnée par l’Opérateur', 'The input for the message [%s2]\r\n\r\n%s1\r\n\r\nwas cancelled by the Operator', NULL, NULL),
(7, 6501, 'COM_ASCII', 'Com Ascii Drv Unknown', 'COM_ASCII_DRV_UNKNOWN', NULL, 0, NULL, NULL, '\r\nLa fonction \"%s2\" n’est pas disponible dans le driver !\r\n\r\nSCPI étendu : %s1', '\r\nUnknown function \"%s2\" into the driver !\r\n\r\nExtended SCPI: %s1', NULL, NULL),
(8, 6502, 'COM_ASCII', 'Com Ascii Drv Init', 'COM_ASCII_DRV_INIT', NULL, NULL, NULL, NULL, 'Erreur d’initialisation du port de %s1 !\r\n\r\nBaud = %i1, Data bit = %i2, Parity = %i3, Time out = %i4, Flow ctrl = %i5\r\n- - - - - - - - - -\r\n%s2', '%s1 port initialization error!\r\n\r\nBaud = %i1, Data bit = %i2, Parity = %i3, Time out = %i4, Flow ctrl = %i5s2, %s3, %s4, %s5\r\n- - - - - - - - - -\r\n%s2', NULL, NULL),
(9, 6503, 'COM_ASCII', 'Com Ascii Drv Flush', 'COM_ASCII_DRV_FLUSH', NULL, 2, NULL, NULL, 'Impossible de vider le buffer \r\n\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', 'Impossible to clear the buffer\r\n\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
(10, 6504, 'COM_ASCII', 'Com Ascii Drv Write', 'COM_ASCII_DRV_WRITE', NULL, 2, NULL, NULL, 'Impossible de transmettre les données\r\n\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', 'Impossible to send the data\r\n\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
(11, 6505, 'COM_ASCII', 'Com Ascii Drv Read', 'COM_ASCII_DRV_READ', NULL, 2, NULL, NULL, '\r\nImpossible de recevoir des données\r\n\r\nLabview err = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', '\r\nImpossibile to receive the data\r\n\r\nLabview err = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
(13, 6101, 'MYSQL', 'MySql Load Test Specific', 'SQL_LOAD_TEST_SPEC', NULL, 0, NULL, NULL, '\r\nImpossible de charger les séquences de la Spécification de contrôle\r\n\r\nRequête SQL\r\n%s1', '\r\nImpossibile to load the sequences of Test Specification\r\n\r\nSQL query\r\n%s1', NULL, NULL),
(14, 6102, 'MYSQL', 'MySql Load Test Sequence', 'SQL_LOAD_SEQUENCE', NULL, 0, NULL, NULL, '\r\nImpossible de charger les étapes pour la séquence de test\r\n\r\nRequête SQL\r\n%s1', '\r\nImpossibile to load the test sequence steps\r\n\r\nSQL query\r\n%s1', NULL, NULL),
(15, 6103, 'MYSQL', 'MySql Load Actions', 'SQL_LOAD_ACTIONS', NULL, 0, NULL, NULL, '\r\nImpossible de charger des actions pour l’étape de test\r\n\r\nRequête SQL\r\n%s1', '\r\nImpossibile to load the actions for the test step\r\n\r\nSQL query\r\n%s1', NULL, NULL),
(16, 6510, 'USER', 'Human interface - Aswer ', 'USER_CONFIRM', NULL, 2, NULL, NULL, 'La réponse au message [%s2]\r\n\r\n%s1\r\n\r\nn’a pas été validée par l’Opérateur', 'The answer to the message [%s2]\r\n\r\n%s1\r\n\r\nwas not validated by the Operator', NULL, NULL),
(32, 6512, 'USER', 'Human interface - Ident', 'USER_IDENT', NULL, 0, NULL, NULL, 'L’identification a été abandonnée par l’Opérateur', 'The identification was cancelled by the Operator', NULL, NULL),
(19, 6515, 'USER', 'Human ident - Check', 'USER_CHECK', NULL, 0, NULL, NULL, '\r\nOpérateur non autorisé sur ce poste !\r\n\r\n%s1\r\n', '\r\nOperator unauthorized on this station!\r\n\r\n%s1\r\n', NULL, NULL),
(22, 6005, 'DRIVER', 'Driver Use Action', 'DRV_USE_ACTION', NULL, 0, NULL, NULL, '\r\n\r\nImpossible d’appeler l’action \"%s2\" de la fonction \"%s1\" du driver', '\r\n\r\nThe action \"%s2\" from the function \"%s1\" of the driver is unavailable', NULL, NULL),
(23, 6010, 'UUT', 'Get Uut Param', 'UUT_REF_UNKNOWN', NULL, 0, NULL, NULL, '\r\nLa spécification de test pour la référence ’%s1’ n’est pas disponible', '\r\nThe test specification for the product reference ’%s1’ isn’t available.', NULL, NULL),
(25, 6201, 'PLUGIN_SCPI', 'Unknown SCPI Target', 'PLUGIN_UNKNOWN_LEVEL_1', NULL, 0, NULL, NULL, '\r\nLa Cible \"%s2\" n’est pas disponible dans le plug-in !\r\n\r\nSCPI étendu : %s1', '\r\nUnknown Target \"%s2\" into the plug-in!\r\n\r\nExtended SCPI: %s1', NULL, NULL),
(26, 6202, 'PLUGIN_SCPI', 'Unknown SCPI Function', 'PLUGIN_UNKNOWN_LEVEL_2', NULL, 0, NULL, NULL, '\r\nLa Fonction \"%s2\" n’est pas disponible dans le plug-in !\r\n\r\nSCPI étendu : %s1', '\r\nUnknown Function \"%s2\" into the plug-in!\r\n\r\nExtended SCPI: %s1', NULL, NULL),
(27, 6203, 'PLUGIN_SCPI', 'Unknown SCPI Organ', 'PLUGIN_UNKNOWN_LEVEL_3', NULL, 0, NULL, NULL, '\r\nL’Organe \"%s2\" n’est pas disponible dans le plug-in !\r\n\r\nSCPI étendu : %s1', '\r\nUnknown Organ \"%s2\" into the plug-in!\r\n\r\nExtended SCPI: %s1', NULL, NULL),
(29, 6011, 'MISC', 'Division by zero', 'DIVISION _BY_ZERO', NULL, 0, NULL, NULL, '\r\nDivision par zéro !\r\n\r\nSCPI étendu : %s1\r\nValeur divisée: %f1 / %f2', '\r\nDivision by zero!\r\n\r\nExtended SCPI: %s1\r\nDivided value: %f1 / %f2', NULL, NULL),
(30, 6204, 'PLUGIN_SCPI', 'Unknown SCPI Action', 'PLUGIN_UNKNOWN_LEVEL_4', NULL, 0, NULL, NULL, '\r\nL’Action \"%s2\" n’est pas disponible dans le plug-in !\r\n\r\nSCPI étendu : %s1', '\r\nUnknown Action \"%s2\" into the plug-in!\r\n\r\nExtended SCPI: %s1', NULL, NULL),
(33, 6513, 'USER', 'Human interface - Date', 'USER_DATE', NULL, 2, NULL, NULL, '\r\nLa saisie de la date a été abandonnée par l’Opérateur', '\r\n\r\nThe date input was cancelled by the Operator', NULL, NULL),
(34, 6205, 'PLUGIN_SCPI', 'Unknown SCPI Select', 'PLUGIN_UNKNOWN_SELECT', NULL, 0, NULL, NULL, 'Impossible de lier le plug-in !\r\n\r\nSCPI étendu : %s2:%s3:%s4:%s5\r\n- - - - - - - - - -\r\n%s1\r\n- - - - - - - - - -\r\n%s6', 'Impossible to link the plug-in!\r\n\r\nExtended SCPI: %s2:%s3:%s4:%s5\r\n- - - - - - - - - -\r\n%s1\r\n- - - - - - - - - -\r\n%s6', NULL, NULL),
(35, 6506, 'COM_ASCII', 'Com Ascii Drv Wait Synch', 'COM_ASCII_DRV_SYNCRO', NULL, 2, NULL, NULL, 'La chaîne attendue \"%s2\" n’est pas arrivée après %i1 essais !\r\nSuite à l’envoi de la commande \"%s1\"\r\nReçu : \"%s3\" \r\n\r\n- - - - - - - - - -\r\nSCPI étendu : %s4', 'The expected string \"%s2\" was not read after %i1 attempts!\r\nAfter the \"%s1\" command sending.\r\nReceived: \"%s3\"\r\n\r\n- - - - - - - - - -\r\nExtended SCPI: %s4', NULL, NULL),
(36, 6522, 'CHECK_VALUE', 'Check value - Less', 'VALUE_CTRL_LESS', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s1\" est supérieure ou égale à la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is greater or equal to the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(37, 6526, 'CHECK_VALUE', 'Check value - Range', 'VALUE_CTRL_RANGE', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s2\" n’est pas dans la plage de valeurs attendues \"%s1\" ?? \"%s3\" (après %s5 essais) !\r\n\r\nValeur = %s2\r\nAttendu = %s1 < ??? < %s3\r\n- - - - - - - - - -\r\nSCPI étendu : %s4', 'The checked value \"%s2\" is not in the expected range \"%s2\" ?? \"%s3\" (after %s5 attempts)!\r\n\r\nValue = %s2\r\nRange = %s1 < ??? < %s3\r\n- - - - - - - - - -\r\nExtended SCPI: %s4', NULL, NULL),
(38, 6520, 'CHECK_VALUE', 'Check value - Equal', 'VALUE_CTRL_EQUAL', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s1\" n’est pas égale à la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is not equal to the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(39, 6521, 'CHECK_VALUE', 'Check value - Diff', 'VALUE_CTRL_DIFF', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s1\" n’est pas différente de la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is equal to the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(40, 6524, 'CHECK_VALUE', 'Check value - More', 'VALUE_CTRL_MORE', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s1\" est inférieure ou égale à la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is lower or equal to the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(41, 6523, 'CHECK_VALUE', 'Check value - Less equal', 'VALUE_CTRL_LESS_EQUAL', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s1\" est supérieure à la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is gretare than the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(43, 6525, 'CHECK_VALUE', 'Check value - More equal', 'VALUE_CTRL_MORE_EQUAL', NULL, 0, NULL, NULL, 'La valeur contrôlée \"%s1\" est inférieure à la valeur attendue \"%s2\" (après %s4 essais) !\r\n\r\nValeur = %s1\r\nAttendu = %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s3', 'The checked value \"%s1\" is lower than the expected value \"%s2\" (after %s4 attempts)!\r\n\r\nValue = %s1\r\nCheck = %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s3', NULL, NULL),
(44, 6527, 'CHECK_VALUE', 'Check value - Range equa', 'VALUE_CTRL_RANGE_EQUAL', NULL, 2, NULL, NULL, 'La valeur contrôlée \"%s2\" est hors de la plage de valeurs attendues \"%s1\" ?? \"%s3\" (après %s5 essais) !\r\n\r\nValeur = %s2\r\nAttendu = %s1 <= ??? <= %s3\r\n- - - - - - - - - -\r\nSCPI étendu : %s4', 'The checked value \"%s2\" is out of the expected range \"%s2\" ?? \"%s3\" (after %s5 attempts)!\r\n\r\nValue = %s2\r\nRange = %s1 <= ??? <= %s3\r\n- - - - - - - - - -\r\nExtended SCPI: %s4', NULL, NULL),
(45, 6528, 'VALUE_DIV', 'Value operator - divide ', 'VALUE_DIV_BY_ZERO', NULL, 0, NULL, NULL, '\r\nDivision par zéro !\r\n\r\nValeur divisé: %s1 / %s2', '\r\nDivision by zero!\r\n\r\nDivided value: %s1 / %s2', NULL, NULL),
(46, 6529, 'VALUE_OPERATOR', 'Value operator - unknown', 'VALUE_OPERATOR_UNKNOWN', NULL, 0, NULL, NULL, '\r\nOpération inconnue \"%s3\" !\r\n\r\nOpération demandée : %s1 %s3 %s2', '\r\nUnknown operation \"%s3\" !\r\n\r\nRequested operation: %s1 %s3 %s2', NULL, NULL),
(47, 6020, 'JUMP', 'Goto - Exit request', 'GOTO_EXIT_REQUEST', NULL, 2, NULL, NULL, '\r\nDemande d’abandon de séquence\r\n\r\n- - - - - - - - - -\r\nSCPI OUT message: %s1', '\r\nSequence cancellation requested\r\n\r\n- - - - - - - - - -\r\nSCPI OUT message: %s1', NULL, NULL),
(48, 6021, 'GOTO', 'Goto Parameters - Err', 'GOTO_PARAMETERS_ERR', NULL, 0, NULL, NULL, 'Les paramètres passés au GOTO ne sont pas valides\r\nParamètre 1 : Label\r\nParamètre 2 : Nbr de boucle maxi\r\n\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', 'The parameters used in the GOTO aren’t available\r\nparameter 1: Label\r\nparameter 2: Max loop number\r\n\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
(49, 6507, 'COM_ASCII', 'Com Ascii Wait Data', 'COM_ASCII_DRV_WAIT', NULL, 2, NULL, NULL, '\r\nPas de donnée reçue après %f1 seconde(s)\r\n\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', '\r\nNo data received after %f1 second(s) waiting\r\n\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
(50, 6206, 'PLUGIN_SCPI', 'Unfound SCPI Instrument', 'PLUGIN_INST_NO_FOUND', NULL, 0, NULL, NULL, 'Erreur d’initialisation de l’instrument %s3\r\n\r\nPas de réponse à la commande : %s2\r\n- - - - - - - - - -\r\nSCPI étendu : %s1', 'Initialization error for the instrument %s3\r\n\r\nNo answer at the request: %s2\r\n- - - - - - - - - -\r\nExtended SCPI: %s1', NULL, NULL),
